from pprint import pprint

from json import dumps as jsdumps
from apiclient import discovery
from oauth2client import client
from oauth2client import tools
from oauth2client.file import Storage

def get_credentials():
    home_dir = os.path.expanduser('~')
    credential_dir = os.path.join(home_dir, '.credentials')
    if not os.path.exists(credential_dir):
        os.makedirs(credential_dir)
    credential_path = os.path.join(credential_dir,
                                   'sheets.googleapis.com-python-quickstart.json')

    store = Storage(credential_path)
    credentials = store.get()
    if not credentials or credentials.invalid:
        flow = client.flow_from_clientsecrets(CLIENT_SECRET_FILE, SCOPES)
        flow.user_agent = APPLICATION_NAME
        if flags:
            credentials = tools.run_flow(flow, store, flags)
        else: # Needed only for compatibility with Python 2.6
            credentials = tools.run(flow, store)
        print('Storing credentials to ' + credential_path)
    return credentials

def send_to_server(json):
    """
    Extracts import data from RCR POST data from CognitoForms and sends to a remove server
    for long-term storage outside of the staff portal
    """
    form_internals = json['Form']
    form_entry = json['Entry']
    values = []
    values.append(json["Id"])
    values.append(json["StaffName"]["First"])
    values.append(json["StaffName"]["Last"])
    values.append(form_entry["DateSubmitted"])
    values.append(json["CWID"])
    values.append(json["Name"]["First"])
    values.append(json["Name"]["Last"])
    values.append(json["CSUFEmail"])
    values.append(json["CheckInCheckOut"])
    values.append(json["Building"])
    values.append(json["RoomNumber"])
    values.append(json["BedSide"])
    values.append(json["Signature"]["Content"])

    credentials = get_credentials()
    http = credentials.authorize(httplib2.Http())
    discoveryUrl = discoveryUrl = ("https://sheets.googleapis.com/$discovery/rest?version=v4")
    service = discovery.build("sheets", "v4", http=http, discoveryServiceUrl=discoveryUrl)

    spreadsheet_Id = "19U9hUL2xfPWueCzasfO9udBcb7FZ-I6EzJKd_o3Ok-c"
    rangeName = "Sheet1"
    value_input_option = "RAW"
    insert_data_option = "INSERT_ROWS"
    value_range_body = {
        "values": [values],
    }
    pprint(value_range_body)

    request = service.spreadsheets().values().append(spreadsheetId=spreadsheet_Id, range=rangeName, valueInputOption=value_input_option, insertDataOption=insert_data_option, body=value_range_body)
    response = request.execute()
